void init_print(Print& print, std::initializer_list<TestMesh> meshes, Slic3r::Model& model, DynamicPrintConfig* _config, bool comments) {
	DynamicPrintConfig &config = Slic3r::DynamicPrintConfig::full_print_config();
    config.apply(*_config);
    
    //remove print of status
    print.set_status_callback([](const PrintBase::SlicingStatus &) {});
    //const std::string v {std::getenv("SLIC3R_TESTS_GCODE")};
    //auto tests_gcode {(v == "" ? ""s : std::string(v))};

    //if (tests_gcode != ""s)
    //    config->set_key_value("gcode_comments", new ConfigOptionBool(true));

    //print.apply_config_perl_tests_only(*config);
    for (const TestMesh& t : meshes) {
        ModelObject* object {model.add_object()};
        object->name += std::string(mesh_names.at(t)) + ".stl"s;
        object->add_volume(mesh(t));

        ModelInstance* inst {object->add_instance()};
        inst->set_rotation(Vec3d(0,0,0));
        inst->set_scaling_factor(Vec3d(1, 1, 1));
    }

    print.apply(model, config); // apply config for the arrange_objects
    arrange_objects(model, InfiniteBed{}, ArrangeParams{ scale_t(10)});//print.config().min_object_distance()) });
    model.center_instances_around_point(Slic3r::Vec2d(100,100));
    for (auto* mo : model.objects) {
        print.auto_assign_extruders(mo);
        //print.add_model_object(mo);
    }
    print.apply(model, config);

    std::pair<PrintBase::PrintValidationError, std::string> err = print.validate();
    //std::cout << "validate result : " << err << ", mempty print? " << print.empty() << "\n";

}

