void gcode(std::string& gcode_path, Print& _print) {
    _print.process();
    gcode_path = _print.export_gcode(gcode_path, nullptr);
}

std::string read_to_string(const std::string& name) {
    std::stringstream buf;
    std::ifstream f{ get_model_path(name) };
    if (!f.good()) f = std::ifstream{ name };
    if (!f.good()) return ""s;
    std::copy(std::istreambuf_iterator<char>(f),
        std::istreambuf_iterator<char>(),
        std::ostreambuf_iterator<char>(buf));
    f.close();
    return buf.str();
}

void clean_file(const std::string& name, const std::string& ext, bool glob) {
    std::string filename{ "" };
    filename.append(name);
    filename.append(".");
    filename.append(ext);

    bool file_exist = false;
    {
        std::ifstream f{ get_model_path(filename) };
        file_exist = f.good();
        f.close();
    }
    if (file_exist) std::remove(get_model_path(filename).c_str());
    else {
        std::ifstream f{ filename };
        file_exist = f.good();
        f.close();
        if (file_exist) std::remove(filename.c_str());
    }
}

Slic3r::Model model(const std::string& model_name, TriangleMesh&& _mesh) {
    Slic3r::Model result;

	ModelObject* object {result.add_object()};
    object->name += model_name + ".stl"s;
    object->add_volume(_mesh);

	ModelInstance* inst {object->add_instance()};
    inst->set_rotation(Vec3d{ 0, 0, 0 });
	inst->set_scaling_factor(Vec3d{ 1, 1, 1 });

    return result;
}

